import Menu from './menu-aberto.png'
import Logo from './yt-logo.png'

function OpenLeftbar() {
    if (document.querySelector('.big-bar').style.display = 'none' == true) {
        document.querySelector('.big-bar').style.display = 'block'
    } else (document.querySelector('.big-bar').style.display = 'none' == false)
        document.querySelector('.big-bar').style.display = 'none'
    
}

function youtubeMenu(){

    

    return (
        <div className="youtube-menu">
        <span onClick={this.OpenLeftbar}><img src={Menu} alt="" /></span>
        <span className='yt-logo'><img src={Logo} alt="" /></span>
        </div>
    )
}

export default youtubeMenu
